import React from 'react';
import '../style/Scoreboard.css'

function Scoreboard() {
    return (
        <div class="container-fluid">
            <div class="row">
                <div class="col">
                1 of 2
                </div>
                <div class="col">
                2 of 2
                </div>
            </div>
        <br />
        </div>    
    );
}

export default Scoreboard;
